    {
        id: 1,
        image: Nasim,
        title: "Nasim Anousheh",
        position: "Professor: Indiana University Bloomington",
        description: "I have had the privilege of working with Sarthak since 2023. He has been serving as a Graduate Teaching Assistant for my graduate-level course, Data Science On-Ramp, which comprises twelve mini-courses. Sarthak's performance has been exceptional. I have no doubts that he is well-prepared to handle the many challenges that a research-based program brings forth. Sarthak Chawathe is a highly talented and dedicated individual whose expertise in Machine Learning, coupled with his exceptional teaching abilities, make him a valuable asset to any organization or educational institution.",
    },
    {
        id: 2,
        image: Kapil,
        title: "Kapil Khandelwal",
        position: "Team Lead: Tata Consultancy Services",
        description: "Sarthak was an exceptional team member during his time with TCS, bringing immense value through his innovative system design and troubleshooting expertise. He significantly boosted our efficiency by streamlining support processes, resolving a high volume of tickets, and generating insightful reports. His proficiency in Agile methodologies, Java, SQL Server, and Microsoft Office was crucial to our success. Sarthak consistently demonstrated professionalism and dedication, leaving a lasting impact. I wish him the best of luck in his pursuit of higher education and future endeavors.",
    },
    {
        id: 3,
        image: Wasique,
        title: "Wasique Ansari",
        position: "Colleague: Tata Consultancy Services",
        description: "During my tenure at Tata Consultancy Services, I collaborated closely with Sarthak for around 1.5 years. Throughout our time together, Sarthak consistently demonstrated exceptional professionalism, technical expertise, and a strong dedication to delivering high-quality results. He exhibited outstanding problem-solving skills and a keen eye for detail, which greatly contributed to the success of the projects at TCS. His ability to adapt to new challenges and work collaboratively within the team was invaluable. Moreover, Sarthak consistently maintained a positive attitude and displayed exemplary communication skills, making him a pleasure to work with.",
    },
    {
        id: 4,
        image: Shubhada,
        title: "Shubhada Labde",
        position: "Professor: KJ Somaiya Institute Of Technology",
        description: "We extend our heartfelt appreciation to Mr. Sarthak Chawathe, former TCS employee and Data Analyst, and an esteemed alumnus of KJ Somaiya Institute of Technology, Mumbai. We are proud to acknowledge his exceptional contributions as a speaker in our Machine Learning & Big Data Analytics winter internship program from 6th Dec to 5th Jan 2022. Additionally, we commend his dedication as a mentor to the final year students during their project journey. Mr. Chawathe's expertise, both as a speaker and a mentor, greatly enriched the program, leaving a lasting impact on all participants.",
    },
    {
        id: 5,
        image: Aditi,
        title: "Aditi Sonawane",
        position: "Project Partner: Indiana University Bloomington",
        description: " I highly recommend Sarthak for any data-related opportunities. He possess exceptional skills, strong work ethic, and a collaborative mindset. Sarthak exhibits exceptional problem-solving abilities, attention to detail, and a positive attitude. His effective communication, adaptability, and growth mindset contribute to a harmonious and productive work environment. Sarthak is poised for success in Data Science and will make significant contributions.",
    },
